export class StaveSignature {
    config;
    log;
    staveLineCount;
    clef;
    key;
    time;
    constructor(config, log, staveLineCount, clef, key, time) {
        this.config = config;
        this.log = log;
        this.staveLineCount = staveLineCount;
        this.clef = clef;
        this.key = key;
        this.time = time;
    }
    parse() {
        return {
            type: 'stavesignature',
            lineCount: this.staveLineCount.getValue(),
            clef: this.clef.parse(),
            key: this.key.parse(),
            time: this.time.parse(),
        };
    }
}
